class Events extends Component {
constructor()
{
super();
this.state={
events:[
    {
id:1,
name:'SRK',
description:'abc',
location:'Switzerland'

},
{
    id:2,
    name :'BuntyBabli',
    description:'xyz',
    location:'kalyan'
    
    },
    {
        id:3,
        name:'ToofanExpress',
        description:'pqr',
        location:'Paris'
        
        }
]
};
}

    render() {
        const {events} =this.state;
        return (
            <div>
                {events.map(event =>(

                    <h1>{event.name}</h1>
                ))}
            </div>
        );
    }
}

export default Events;
